import React from 'react'
import {
    Row,
    Col,
  } from "reactstrap";
  import BookingChart from "../statistical/BookingChart";


function Staticcal() {
  return (
    <Row>
          <Col xs={12} md={3}>
            <h1>-----------------------</h1>
            <h1>Số tiền booking trong năm </h1>
            <BookingChart /> 
            <h1>-----------------------</h1>
          </Col>
    </Row>
  )
}

export default Staticcal
